import React from 'react';
import { Link, Outlet } from "react-router-dom";

export default function Menu() {
  return (
    <div>
      <nav className="bg-gray-800 text-white px-6 py-4 shadow-md">
        <ul className="flex space-x-6 text-lg font-medium">
          <li><Link to="/" className="hover:text-yellow-300 transition">Home</Link></li>
          <li><Link to="/Passwords" className="hover:text-yellow-300 transition">Contrase√±as</Link></li>
          <li><Link to="/Groups" className="hover:text-yellow-300 transition">Grupos</Link></li>
          <li><Link to="/AccessHistory" className="hover:text-yellow-300 transition">Historial</Link></li>
		  <li><Link to="/Send" className="hover:text-yellow-300 transition">Enviar</Link></li>
		  <li><Link to="/Settings" className="hover:text-yellow-300 transition">Ajustes</Link></li>
        </ul>
      </nav>
      
      <div className="p-6 bg-gray-100 min-h-screen">
        <Outlet />
      </div>
    </div>
  );
}
